Kegiatan rutin K3 (Kebersihan, Keindahan, dan Ketertiban) kembali dilaksanakan pada hari Jumat dan Sabtu bersama seluruh aparatur Kelurahan Jatimekar. Dengan penuh semangat gotong royong, para aparatur membersihkan lingkungan kantor kelurahan, mulai dari halaman depan hingga seluruh area di sekitar kantor. Penyapuan, pengumpulan sampah daun kering, serta penataan lingkungan dilakukan bersama untuk menciptakan suasana yang bersih, indah, dan nyaman. Kegiatan ini menjadi bentuk nyata kepedulian aparatur Kelurahan Jatimekar dalam menjaga kebersihan lingkungan serta memberikan contoh positif kepada masyarakat. Dengan adanya kegiatan K3 secara rutin, diharapkan tercipta lingkungan kantor yang tertata rapi, nyaman, dan semakin mendukung pelayanan kepada warga.

